import Vue from "vue";
import Router from "vue-router";
import Home from "./views/Home.vue";

Vue.use(Router);

export default new Router({
  routes:
  [
  {
    path: "/",
    name: "home",
    component: Home
  },
  {
    path: "/about",
    name: "about",
    component: () =>
    import(/* webpackChunkName: "about" */ "./views/about.vue")
  },
  {
    path: "/details",
    name: "details",
    component: () =>
    import(/* webpackChunkName: "about" */ "./components/details.vue")
  }
  ]
});
